import axios from 'axios';
import { ridesAdd } from '../redux/reducers/ridesData';

const ApiRides = dispatch => {


    axios.get('https://assessment.api.vweb.app/rides').then(

        res => dispatch(ridesAdd({rides_data: res.data})) 

    )

} 

export default ApiRides;
